description:
The Dennis Prager Radio Show APR-12-2013 FRI







Prager 20130412  03 Open Lines

Prager H3: Per usual, callers set the agenda.
 Issues raised include:
 have you noticed the rise in profanity in the left;
 what book do you suggest for a paper on American history;
 what is your take on the femininity of god..
 what do you think the basketball players answers were to the questions 
''how would you fare against someone like Michael Jordan?'';
 if the culture informs behavior as you have said... how does that jive with gay men being born that way.


Prager 20130412  02 Happiness Hour: Expectations

Prager H2: Managing expectations..
 not expecting too much and being grateful for what you do have..
 is one of the keys to a happier life.
 Dennis draws a clear distinction between desires and expectations.


Prager 20130412  01 Throwing away the Dough

Prager H1: USC political science Prof. Darry Sragow slanders republicans in the worst way.
 Dennis takes calls from parents worried about their kids in school...
 offers Sragow to come on the show in exchange for equal amount of time in his class. 

















